import React, { Fragment } from "react";
import { Link } from "react-router-dom";


const MyListItem = ({ anime }) => {
    return (
        <Fragment>
            <td>
                <Link> anime.name</Link>

            </td>
            <td>anime.episodes</td>
            <td>anime.grade</td>
        </Fragment>
    )
}
